public class WebSocketNumberFormatException extends Exception {
    public WebSocketNumberFormatException() {
        super();
    }

    public WebSocketNumberFormatException(String message) {
        super(message);
    }

    public WebSocketNumberFormatException(String message, Throwable cause) {
        super(message, cause);
    }

    public WebSocketNumberFormatException(Throwable cause) {
        super(cause);
    }
}
